//client/src/Home.js
import {Component} from 'react';
import Login from './login';
import Signup from './signup';


class Home extends Component{

  state = {
    current_component_that_is_rendered: <Login />
  }

  handleClick = (choice) => {
    if (choice === 'login'){
      this.setState({current_component_that_is_rendered: <Login />})
    }

    else if (choice === 'signup'){
      this.setState({current_component_that_is_rendered: <Signup />})
    }
  }
  render(){
    return(
      <div>
        {current_component_that_is_rendered}
        <button className="user_choice_button" onClick={event => this.handleClick('login')}>Login</button>
        <button className="user_choice_button" onClick={event => this.handleClick('login')}>Login</button>
      </div>
    )
  }
}
export default Home;
